(1242,1706,1,'About','2022-05-05 01:12:11','2022-05-05 01:12:11','222f8989-51be-48d7-a59c-7bdddd04537e',NULL,'<h4>When Dave Rudolph first picked up a guitar at just 3 years old, few could\'ve predicted the journey it would lead him on. The love and pursuit of music has taken him across the country and made him lifelong fans and friends alike! </h4>\n<h4><br /></h4>\n<h4>A veteran performer from Akron, Ohio, Dave has performed over 1000 live shows with a wide variety of bands, both live and in the studio. Dave has opened for major acts, such as Jake Owen, Chris Janson, Tracy Byrd, Tyler Farr, Saving Abel, Josh Thompson, and Craig Campbell. </h4>\n<h4><br /></h4>\n<h4>Dave has performed at events ranging from the NFL Hall of Fame Induction Ceremony, WGAR Country Jam, CMA Fest, Bus Call, Piqua Bike Fest, and Hamler Country Fest, to the shows at Tootsies Orchid Lounge, Honky Tonk Central, Kid Rock\'s Big Ass Honky Tonk, Dierks Bentley\'s Whiskey Row, Thirsty Cowboy, The Little Red Rooster, The Dusty Armadillo, and the world famous traveling Jaegermeister Stage! Tours have laid rubber from Cleveland to Nashville, Oklahoma City to Seattle, Bemidji to Woodruff, and many places between. </h4>\n<h4><br /></h4>\n<h4>While currently residing in Nashville, be sure to catch Dave performing with his band on Lower Broadway!</h4>\n<h4><br /></h4>\n<h4>Currently available for gigs as a frontman, sideman (vocal harmonies/lead guitar), co-writing, session work, and guitar lessons - send me a message through the contact page!</h4>\n<figure><img class=\"img-fluid\" src=\"{asset:621:url||/uploads/DSC_9613.jpg}\" alt=\"Dave Rudolph Fender Tele Telecaster Black Leather Jacket Ripped Jeans Rustic Brooding Intense Serious Musician Promo Picture Photo Guitar Sexy Man Guitarist Singer American Country Rock Outlaw\" /><figcaption>Dave Rudolph with his Telecaster - Photo by Anna Bey Photography</figcaption></figure>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
